function update(req,res){
    Govt.findById(req.params.id, (err,foundGovt) => {
        if(err){
            console.log(err)
            req.flash("error","Unexpected Error Occured!!!")
            res.redirect("/govtIndex")
        }else{
            if(!foundGovt){
                res.redirect("/")
            }else{
                foundGovt.companies = updateGovt.companies; foundGovt.products = updateGovt.products;
                foundGovt.customerSatisfactionsRating = updateGovt.customerSatisfactionsRating;
                foundGovt.customers = updateGovt.customers; foundGovt.waterSaved = updateGovt.waterSaved;
                foundGovt.hospitalStaff = updateGovt.hospitalStaff; foundGovt.recentProjects = updateGovt.recentProjects;
                foundGovt.hospitalServey = updateGovt.hospitalServey; foundGovt.customerSatisfactions = updateGovt.customerSatisfactions;
                foundGovt.companiesLists = updateGovt.companiesLists; foundGovt.customerSatisfactionsNum = updateGovt.customerSatisfactionsNum;
                foundGovt.save((err,savedGovt)=>{
                    if(err){
                        console.log(err)
                        req.flash("error","Unexpected Error Occured!!!")
                        res.redirect("/govtIndex")
                    }else{
                        Govt.findByIdAndUpdate(req.params.id,savedGovt, (err,updatedGovt) => {
                            if(err){
                                console.log(err)
                                req.flash("error","Unexpected Error Occured!!!")
                                res.redirect("/govtIndex")
                            }else{
                                req.flash("success","Date Updated Successfully!!!")
                                res.redirect("/govtIndex")
                            }
                        } )
                    }
                })
            }
        }
    } )
}

module.exports = update